import { render } from "react-dom";

class Symptoms extends React.Component {

    symptomList = [
        "Sore Throat.",
        "Fatigue.",
        "Hungry for pizza.",
        "Tired of being home.",
        "Body aches.",
        "Empty Wallet.",
        "Sleepy",
        "TBD symptom",
        "Face mask tan",
        "Long hair or mullet",
        "Feeling hot outside"
    ];


render() {


    return (
        <div>
            <p>New Side Effects Include..</p>

            <div>{this.symptomList[0]}</div>
        </div>
    )
        



}


}

export default Symptoms;
